import css from './FriendList.module.css'

export const FriendList = ({ friends }) => {
  return (
    <ul className={css.FriendList}>
      {friends.map((friend) => {
        return (
          <li className={css.item}>
            <span className="status"></span>
            <img className="avatar" src="" alt="User avatar" width="48" />
            <p className="name"></p>
          </li>
        );
      })}
    </ul>
  );
};
